import "./App.css";
import React, { Component } from "react";

export default class App extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return <div className="App">
      <div>Caro Collazo</div>
      <div>Navigation</div>
      <div></div>
    </div>;
  }
}
